import pic from "./dp.svg"
import logo from "./logo1.svg"
const dashboard = () => {
 return (

    <div className="dp">
        <nav className="navbar">
        <div className="logo">
            <img src={logo} alt="reddit" className="image"/>
        </div>
        <div className="items">
            <li>Home</li>
            <li>About</li>
            <li>Services</li>
        </div>
        </nav>
        <img src={pic} alt="dp" className="img_dp"/>
    </div>
 );
}
export default dashboard;
